import { createBrowserRouter, createRoutesFromElements, Route, RouterProvider } from "react-router-dom";
import HomePage from "./page/HomePage.jsx";
import EventPage, {loader as eve} from "./page/EventPage.jsx";
import EventDetailPage from "./page/EventDetailPage.jsx";
import NewEventPage from "./page/NewEventPage.jsx";
import EditEventPage from "./page/EditEventPage.jsx";
import Root from "./page/Root.jsx";
import EventRoot from "./page/EventRoot.jsx";

const routeDefinitions = createRoutesFromElements(
  <Route path="/" element={<Root />}>
    <Route index element={<HomePage />} />
    <Route path="events" element={<EventRoot />}>
      <Route
        index
        element={<EventPage />}
        loader={async () => {

        }}
      />
      <Route path=":id" element={<EventDetailPage />} />
      <Route path="new" element={<NewEventPage />} />
      <Route path=":id/edit" element={<EditEventPage />} />
    </Route>
  </Route>
);

const router = createBrowserRouter(routeDefinitions);

function App() {
  return <RouterProvider router={router} />;
}

export default App;
